import React from 'react';
import CardContainer from '../containers/CardContainer';

const Cards = ({ list = {} }) => {
  return (
    <div>
      {list.cards.map(cardId => (
        <CardContainer key={cardId} cardId={cardId} />
      ))}
    </div>
  );
};

export default Cards;
